import {Map, GoogleApiWrapper, Marker, mapEventHandler} from 'google-maps-react'
import React, { Component } from 'react'

const mapStyles = {
  width: 400,
  height: 400,
  position: 'relative',
  border: 'solid #d69e2e',
}

export class MapContainer extends Component<{ google: any }> {
  onMapClicked: mapEventHandler

  render(): any {
    return (
      <Map google={this.props.google} style={mapStyles} initialCenter={{ lat: 47.95497, lng: 22.3261 }}>
        <Marker onClick={this.onMapClicked}/>
      </Map>
    )
  }
}

export default GoogleApiWrapper({ apiKey: 'AIzaSyBmJMPAWVynDTMS389rYx650rDG6-Syb_c' })(MapContainer)
